import React, { Component } from 'react';
import ItemToReplace from "../item-to-replace/item-to-replace.component";
import "./item-to-replace-list.style.scss";

class ItemToReplaceList extends Component {
    constructor(props) {
        super(props);
        this.state = {};
    }
    render() { 
        const {items} = this.props;
        return ( 
            <div className="content">
                <ItemToReplace />
                <ItemToReplace />
                <ItemToReplace />
                <ItemToReplace />
                <ItemToReplace />
                <ItemToReplace />
                <ItemToReplace />
                <ItemToReplace />
                <ItemToReplace />
                <ItemToReplace />
                <ItemToReplace />
                <ItemToReplace />
                <ItemToReplace />
                <ItemToReplace />
            </div>
         );
    }
}
 
export default ItemToReplaceList;
